import Layout from '../components/Layout'

const Registration = () =>  {

    const registrationForm = () => (
        <form>
            Form
        </form>
    )

    return (
        <Layout>
            <div className="col-md-6 offset-md-3">
                <h1>Register</h1>
                <br />
                {registrationForm()}
            </div>
        </Layout>
    )
}
export default Registration
